package kr.co.subway.headOffice.vo;

public class ApplyPageBound {
	private int start;
	private int end;
	public ApplyPageBound() {
		super();
		// TODO Auto-generated constructor stub
	}
	public ApplyPageBound(int start, int end) {
		super();
		this.start = start;
		this.end = end;
	}
	public int getStart() {
		return start;
	}
	public void setStart(int start) {
		this.start = start;
	}
	public int getEnd() {
		return end;
	}
	public void setEnd(int end) {
		this.end = end;
	}
	
}
